import React from 'react';
import ControlCard from './ControlCard/ControlCard';
import {Button} from 'primereact/button';

const dashBoardCitas = (props) => {

   let cards = (props.dashBoard.map((card, index) =>{
        return <ControlCard title={card.title} 
        detail={card.detail}
        count={card.count} 
        clase={card.clase} 
        key = {index}  
        />
    }));


    return (
    <div className="p-grid p-fluid dashboard">
    {cards}
    <div className="p-col-12 p-lg-12">
        <div className="card summary" style={{padding :'0em'}}>
            <Button label="Nueva Cita" icon="pi pi-plus" iconPos="left" className="p-button-success" onClick={props.openNew} style={window.rolUsuario == 1 ?  {display:'block'} :  window.rolUsuario == 4 ? {display:'block'} : {display:'none'}} />
        </div>
    </div>
    </div>);
};

export default dashBoardCitas;
